    html
    frontmatter {
      date(formatString: "MMMM DD, YYYY")
      path
      title
      image {
        childImageSharp {
          resize(width: 1500, height: 1500) {
            src
          }
          fluid(maxWidth: 786) {
            ...GatsbyImageSharpFluid
          }
        }
      }
    }
  }
}

